function Persons({ persons, onClick }) {
  return (
    <ul>
      {persons.map((person) => {
        console.log("person", person);
        return (
          <li key={person.id}>
            <div>
              <p style={{ display: "inline" }}>
                {person.name} {person.number}
              </p>
              <button
                style={{ marginInline: 16 }}
                onClick={() => onClick(person.id)}
              >
                delete
              </button>
            </div>
          </li>
        );
      })}
    </ul>
  );
}

export default Persons;
